import './App.css';
import Login from './Routing/Login';
// import Login from "./Routing/Login";
import Signup from "./Routing/Signup";
import { Routes, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">

      <Routes>
        <Route path='/login' element={<Login/>}></Route>
      </Routes>




     <Signup/>
    </div>
  );
}

export default App;
